    uint256 public totalAmount; //红包金额
    uint256 public count; //红包的数量
    bool public isEqual; //是否是等额红包
    uint256 public expireTime; //红包过期时间
    bool public isActive; //红包是否激活
    //谁已经抢到过这个红包
    mapping(address => uint256) public grabbed;

    event DepositMade(
        address indexed depositor,
        uint256 amount,
        uint256 count,
        bool isEqual,
        uint256 expireTime
    );
    // 定义 GrabSuccess 事件
    event GrabSuccess(address indexed grabber, uint256 amount);
    // 定义 RefundMade 事件
    event RefundMade(address indexed owner, uint256 amount);
    // 定义 onlyOwner 修饰符
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
    // 定义 isNotExpired 修饰符
    modifier isNotExpired() {
        require(block.timestamp < expireTime, "Red packet has expired");
        _;
    }

    constructor() {
        // 只有部署合约的人能购发红包
        owner = msg.sender;
    }

    // 发红包
    function deposit(
        uint256 _count,
        bool _isEqual,
        uint256 _expireHours
    ) public payable {
        // 检查红包是否已经激活
        require(!isActive, "A red packet is already active");
        // 检查红包金额是否大于 0
        require(msg.value > 0, "Amount must be greater than 0");
        // 检查红包数量是否大于 0
        require(_count > 0, "Count must be greater than 0");
        // 检查红包金额是否大于等于红包数量
        require(msg.value >= _count, "Amount must be greater than count");
        // 设置红包参数
        count = _count;
        // 设置红包是否等额
        isEqual = _isEqual;
        // 设置红包金额
        totalAmount = msg.value;
        // 设置红包过期时间
        expireTime = block.timestamp + _expireHours * 1 hours;
        // 设置红包激活状态
        isActive = true;

        emit DepositMade(msg.sender, msg.value, _count, _isEqual, expireTime);
    }

    // 抢红包
    function grabRedPacket() public isNotExpired {
        require(isActive, "No active red packet");
        require(count > 0, "No red packets left");
        require(grabbed[msg.sender] == 0, "Already grabbed");

        uint256 amount;
        if (isEqual) {
            amount = totalAmount / count;
        } else {
            // 使用区块信息和地址生成伪随机数
            uint256 randomSeed = uint256(
                keccak256(
                    abi.encodePacked(
                        blockhash(block.number - 1),
                        msg.sender,
                        block.timestamp
                    )
                )
            );

            if (count == 1) {
                amount = totalAmount;
            } else {
                // 保证金额在合理范围内
                uint256 maxAmount = (totalAmount * 2) / count;
                amount = (randomSeed % maxAmount) + 1;
                if (amount > totalAmount) amount = totalAmount;
            }
        }

        count--;
        totalAmount -= amount;
        grabbed[msg.sender] = amount;

        payable(msg.sender).transfer(amount);
        emit GrabSuccess(msg.sender, amount);

        if (count == 0) {
            isActive = false;
        }
    }

    // 查询红包信息
    function getRedPacketInfo()
        public
        view
        returns (
            uint256 remaining,
            uint256 remainingCount,
            bool equalDistribution,
            uint256 expiryTime,
            bool active
        )
    {
        return (totalAmount, count, isEqual, expireTime, isActive);
    }

    // 查询抢到的金额
    function getGrabbedAmount(address user) public view returns (uint256) {
        return grabbed[user];
    }

    // 超时退款
    function refund() public onlyOwner {
        require(block.timestamp >= expireTime, "Not expired yet");
        require(isActive, "No active red packet");
        require(totalAmount > 0, "No amount to refund");

        uint256 refundAmount = totalAmount;
        totalAmount = 0;
        count = 0;
        isActive = false;

        payable(owner).transfer(refundAmount);
        emit RefundMade(owner, refundAmount);
    }

    receive() external payable {}
}
